import React from 'react';
import "./Paginas.css";

const Accesorios = () => {


  return (
    <div className="titulo-home">
    <div className="titulo-paginas">
      <h1>Lista de productos</h1>
      <p>Lo mejor esta por venir</p>
    </div>
    </div>
  );
};

export default Accesorios;
